import React from 'react'
import './styles/card.css'
import { Player } from "../";





export default function Card(image) {

    return (
        
        <div className = "cards">        
            <div className ="card">
                
                <div className="cardImage">
                    <img className="card__image" src={image} />
                </div> 

            </div>  
            
            
        </div>    
            

        

        
    )
}
